import React from 'react'
import { Link } from 'react-router-dom'

const Welcome = () => {
  return (
    <div>
    <h1>Welcome to Admin Module</h1>
    <h3>To view exams click below</h3>
    <Link to="admin/updateExam"><button>View exams</button></Link>
    </div>
  )
}

export default Welcome
